import {
    Button,
    Divider,
    Grid,
    ListItemSecondaryAction,
    ToggleButton,
    ToggleButtonGroup,
    Typography,
} from "@mui/material";
import '../App.css'
import React, {useEffect, useState} from "react";
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import {CssTextField, ReadOnlyTextField} from "../Utils/CustomTextFields";
import {Navigate, useLocation} from "react-router-dom";
import ListItemText from "@mui/material/ListItemText";
import ListItemButton from "@mui/material/ListItemButton";
import Dialog from "@mui/material/Dialog";
import DialogTitle from "@mui/material/DialogTitle";
import DialogContent from "@mui/material/DialogContent";
import DialogContentText from "@mui/material/DialogContentText";
import DialogActions from "@mui/material/DialogActions";
import {getUsers} from "../APIs/UserAPI";

type ButtonStyleType = {
    background: string,
    color: string
}

const activeButtonColor: ButtonStyleType = {
    background: '#feac0d',
    color: '#ffffff'
}

const inactiveButtonColor: ButtonStyleType = {
    background: '#ffffff',
    color: '#feac0d'
}

// private String nome;
// private String cognome;
// private String email;
// private String codicefiscale;
// private String residenza;
// private String domicilio;
// private String data_nascita;
// private int stato;
// private long telefono;

const PersonalData = () => {
    const location = useLocation()
    const buttons = ['Dati', 'Vaccini', 'Bonus']
    const labels = ['Nome', 'Cognome', 'Email', 'Codice fiscale', 'Residenza', 'Domicilio', 'Data di nascita', 'Stato', 'Telefono', 'dato10']
    const [dataList, setDataList] = useState<any[]>(['Michele', 'Staffieri', 'michelestaf@gmail.com', 'STFMHL98R07F052Y', 'Via Agna, 12, Matera (MT) 75100, Italia', 'Via Agna, 12, Matera (MT) 75100, Italia', '7 ottobre 1998', 'ATTIVO', '3348405461'])
    const [vaxinesList, setvaxinesList] = useState<any[]>(['vaccino1', 'vaccino2', 'vaccino3', 'vaccino4'])
    const [bonusList, setBonusList] = useState<any[]>(['bonus1', 'bonus2'])
    const [showingList, setShowingList] = useState<any[]>(dataList)
    const [activeButton, setActiveButton] = useState<String>(buttons[0]);
    const [firstButton, setFirstButton] = useState<ButtonStyleType>(activeButtonColor)
    const [secondButton, setSecondButton] = useState<ButtonStyleType>(inactiveButtonColor)
    const [thirdButton, setThirdButton] = useState<ButtonStyleType>(inactiveButtonColor)
    const [selectedVaxine, setSelectedVaxine] = useState(null)
    const [selectedBonus, setSelectedBonus] = useState(null)
    const token = location.state?.token
    const isAdmin = location.state?.isAdmin
    const loginType = location.state?.loginType

    console.log(location.state)

    useEffect(() => {
        if (token !== undefined || isAdmin !== undefined || loginType !== undefined) {
            getUsers()
        }
    })


    if (token === undefined || isAdmin === undefined || loginType === undefined) {
        console.log('non sei loggato')
        return <Navigate to='/'/>
    }

    const handleOperation = () => {
        if (activeButton === buttons[0]) {
            console.log('MODIFICO I DATI')
        } else if (activeButton === buttons[1]) {
            console.log('PRENDO I VACCINI')
        } else if (activeButton === buttons[2]) {
            console.log('PRENDO I BONUS')
        }
    }

    const handleChange = (event: React.MouseEvent<HTMLElement>, newActiveButton: string,) => {
        if (newActiveButton === buttons[0]) {
            setFirstButton(activeButtonColor)
            setSecondButton(inactiveButtonColor)
            setThirdButton(inactiveButtonColor)
            setShowingList(dataList)
        } else if (newActiveButton === buttons[1]) {
            setFirstButton(inactiveButtonColor)
            setSecondButton(activeButtonColor)
            setThirdButton(inactiveButtonColor)
            setShowingList(vaxinesList)
        } else if (newActiveButton === buttons[2]) {
            setFirstButton(inactiveButtonColor)
            setSecondButton(inactiveButtonColor)
            setThirdButton(activeButtonColor)
            setShowingList(bonusList)
        }
        setActiveButton(newActiveButton)
    }

    const handleClick = (data: any) => {
        if (activeButton === buttons[1]) {
            setSelectedVaxine(data)
        } else if (activeButton === buttons[2]) {
            setSelectedBonus(data)
        }
    }

    return (
        <>
            <Grid container spacing={2} justifyContent="center" alignItems="center">
                <Grid item xs={12} display="flex" justifyContent="center" alignItems="center">
                    <ToggleButtonGroup value={activeButton} exclusive onChange={handleChange} aria-label="Platform"
                                       sx={{position: 'fixed', top: 5}}>
                        <ToggleButton style={{
                            backgroundColor: firstButton.background,
                            color: firstButton.color,
